import logo from './logo.svg';
import styles from '../src/App.module.css';
import SignUp from './Pages/Sigup';
import axios from 'axios';
import { useState } from 'react';
import { auth, googleProvider, signInWithPopup } from '../src/Services/firebase';
import Login from '../src/Pages/Login';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Dashboard from './Pages/Dashboard';
import Tracker from './Pages/Tracker';
import Sides from './Pages/Sides';
import PrivateRoute from './Components/PrivateRoute';

function App() {
  const [steps, nextSteps] = useState(1);
  const [progress, setProgress] = useState(0);
  const [menuOpen, setMenuOpen] = useState(false);
  const [toggle, setToggle] = useState(false);

  const [signUpData, setSignUpData] = useState({
    email: "",
    password: "",
    age: "",
    height: "",
    weight: "",
    firstName: ""
  });

  const [loginData, setLoginData] = useState({
    email: "",
    password: ""
  });

  const isAuthenticated = !!localStorage.getItem('auth_token');

  const toggleMenu = () => {
    setMenuOpen((prev) => !prev);
  };

  const handleLogout = async () => {
    const token = localStorage.getItem('auth_token');
    if (token) {
      try {
        const response = await axios.post('http://localhost:8000/api/logout/', {}, {
          headers: {
            'Authorization': `Token ${token}`
          }
        });
        console.log(response.data);
        localStorage.removeItem('auth_token');
        window.location.href = '/';
      } catch (error) {
        console.log('Error logging out:', error);
      }
    } else {
      console.log('No token found. Already logged out.');
    }
  };

  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Login Route */}
          <Route
            path="/"
            element={
              <Login
                handleNext={() => nextSteps(steps + 1)}
                steps={steps}
                data={loginData}
                handleChange={(e) => setLoginData({ ...loginData, [e.target.name]: e.target.value })}
                handleLogin={(e) => {
                  e.preventDefault();
                  console.log("Login logic here");
                }}
                handleGoogleSignIn={async () => {
                  try {
                    const result = await signInWithPopup(auth, googleProvider);
                    const token = await result.user.getIdToken();
                    console.log("Google Sign-In Token:", token);
                    window.location.href = "/Dashboard";
                  } catch (error) {
                    console.error("Error during Google sign-in:", error);
                  }
                }}
              />
            }
          />

          {/* Sign-Up Route */}
          <Route
            path="/SignUp"
            element={
              <SignUp
                handleNext={() => nextSteps(steps + 1)}
                steps={steps}
                data={signUpData}
                handleChange={(e) => setSignUpData({ ...signUpData, [e.target.name]: e.target.value })}
                handleSignUp={(e) => {
                  e.preventDefault();
                  console.log("Sign-Up logic here");
                }}
                selectedValue=""
                handleSelectedValue={(e) => console.log(e.target.value)}
                handleProfileChange={(e) => setSignUpData({ ...signUpData, [e.target.name]: e.target.value })}
                handleGoogleSignIn={async () => {
                  try {
                    const result = await signInWithPopup(auth, googleProvider);
                    console.log("Google Sign-Up Token:", result.user.getIdToken());
                  } catch (error) {
                    console.error("Error during Google sign-up:", error);
                  }
                }}
              />
            }
          />

          {/* Dashboard (Private Route) */}
          <Route
            path="/Dashboard"
            element={
              <PrivateRoute isAuthenticated={isAuthenticated}>
                <Dashboard
                  toggle={toggle}
                  toggleMenu={toggleMenu}
                  menuOpen={menuOpen}
                  progress={progress}
                  logout={handleLogout}
                />
              </PrivateRoute>
            }
          />

          {/* Tracker */}
          <Route
            path="/Tracker"
            element={
              <Tracker
                toggle={toggle}
                toggleMenu={toggleMenu}
                menuOpen={menuOpen}
                getMealData={() => console.log("Fetch meal data logic here")}
              />
            }
          />

          {/* Sides */}
          <Route path="/Sides" element={<Sides />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
